import React from "react";
import "../styles/ProductCatalogue.css";

const Products = () => {
  const products = [
    { id: 1, name: "Laptop", price: "$999", image: "/images/laptop.jpg" },
    { id: 2, name: "Headphones", price: "$199", image: "/images/headphones.jpg" },
    { id: 3, name: "Smartphone", price: "$799", image: "/images/smartphone.jpg" },
    { id: 4, name: "Smartphone", price: "$799", image: "/images/smartphone.jpg" },
    { id: 3, name: "Smartphone", price: "$799", image: "/images/smartphone.jpg" },
    { id: 3, name: "Smartphone", price: "$799", image: "/images/smartphone.jpg" },
  ];

  return (
    <div className="container mt-4">
      <h2 className="text-center">Product Catalogue</h2>
      <div className="row">
        {products.map((product) => (
          <div className="col-md-4" key={product.id}>
            <div className="card">
              <img src={product.image} className="card-img-top" alt={product.name} />
              <div className="card-body text-center">
                <h5 className="card-title">{product.name}</h5>
                <p className="card-text">{product.price}</p>
                <button className="btn btn-success">Add to Cart</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
